import React from 'react';

class App extends React.Component{
	render() {
		return (
				<Select
				label="React Multiple Select"
				placeholder="Pick some"
				options={[
					{ value: 'Rock' },
					{ value: 'Paper' },
					{ value: 'Scissors' }
				]}
				multiple
				/>
		);
	}
}
export default App;
